</li><li>Clean all soap holders - remove soap scum</li><li>Clean exhaust fan</li><li>Clean high touch areas</li><li>Clean light fittings where accessible</li><li>Remove dust from skirting boards</li><li>Clean all door and window frames</li></ul></div></div><div data-modal-content="bedrooms-entrance-hallway-lounge-diningrooms"><h3>BEDROOMS / ENTRANCE / HALLWAY / LOUNGE / DINING Rooms</h3><ul><li>Remove cobwebs throughout</li><li>Clean fixtures (switches/doorbell/door handles/locks)</li><li>Clean high touch areas</li><li>Remove dust and clean ceiling fans</li><li>Clean all light switches and electrical outlets</li><li>Remove dust from skirting boards.</li><li>Clean light fittings where accessible</li><li>Cleaning of vents (air conditioning)</li><li>Clean all door and window frames.</li><li>Vacuum/mop flooring (as required).</li></ul></div><div data-modal-content="wardrobes-cupboards"><h3>Wardrobes / Cupboards</h3><ul><li>Mirrored wardrobes - vacuum and clean tracks and frames</li><li>Clean all shelves and drawers (all levels)</li><li>Remove stickers and adhesives</li><li>Clean glass surfaces</li></ul></div><div data-modal-content="laundry"><h3>Laundry</h3><ul><li>Remove all dust/lint</li><li>Remove lint from exhaust fan (ceiling)</li><li>Clean tile floors</li><li>Clean sink and tubs</li><li>Remove dust from skirting boards</li><li>Clean light fittings where accessible</li><li>Clean all door and window frames</li><li>Clean internal cupboards</li><li>Clean external cupboards</li></ul></div><div data-modal-content="eol-kitchen"><h3>Kitchen</h3><ul><li>Degrease and wipe down all surfaces</li><li>Clean external cupboards/handles</li><li>Clean all sinks and taps</li><li>Clean all appliances including dishwasher</li><li>Full detail of stove top</li><li>Full detail of exhaust fan/range hood</li><li>Full detail of splash backs</li><li>Clean high touch areas</li><li>Clean all internal cupboards (including pantry)</li><li>Clean all internal drawers - remove all debris/paper/staining</li><li>Clean light fittings where accessible</li><li>Clean all door and window frames</li></ul></div><div data-modal-content="oven"><h3>Oven</h3><ul><li>Oven cleaned using proper oven cleaner</li><li>Internal clean of oven/grill including glass</li><li>All grease/grime and evidence of use is removed</li><li>Degrease and clean grill and grill plates</li><li>Wipe down and clean on front of oven</li></ul></div><div data-modal-content="pantry-cupboards"><h3>Pantry / Cupboards</h3><ul><li>Clean all shelves</li><li>Clean all drawers</li><li>Clean all doors/handles</li></ul></div><div data-modal-content="balcony"><h3>Balcony</h3><ul><li>Balcony railings wiped down</li><li>All debris swept from balcony</li><li>Cobwebs removed from brickwork</li><li>Sliding door tracks cleaned</li><li>Tiles mopped down</li><li>Light fittings removed, cleaned and bugs cleared</li><li>Sliding door glass, tracks and frames cleaned</li><li>All non-permanent stains removed from balcony flooring</li></ul></div><div data-modal-content="fridge-clean"><h3>Fridge Clean</h3><ul><li>Wipe down of accessible surfaces.</li></ul></div><div data-modal-content="balcony-clean"><h3>Balcony Clean</h3><ul><li>Dusting, sweeping and mopping of accessible surfaces.</li></ul></div><div data-modal-content="after-party-clean"><h3>After Party Clean</h3><ul><li>Pack and remove and dispose all rubbish/ bottles ( we will use your bins and don’t worry place the recyclables in the appropriate bins)</li><li>Undertake full internal clean wiping down all surfaces and paying special attention to the higher traffic areas such as the toilet and floors</li><li>Leave the place smelling great and clean so you don’t have to worry</li></ul></div><div data-modal-content="oven-clean"><h3>Oven Clean</h3><ul><li>Oven cleaned using proper oven cleaner</li><li>Internal clean of oven/grill including glass</li><li>All grease/grime and evidence of use is removed</li><li>Degrease and clean grill and grill plates</li><li>Wipe down and clean on front of oven</li></ul></div><div data-modal-content="cupboards-clean"><h3>Cupboards Clean</h3><ul><li>Wipe down of accessible surfaces.</li></ul></div><div data-modal-content="kitchen-cupboards-clean"><h3>Cupboards Clean</h3><ul><li>Wipe down of accessible surfaces.</li></ul></div><div data-modal-content="pantry-clean"><h3>Pantry Clean</h3><ul><li>Wipe down of accessible surfaces.</li></ul></div><div data-modal-content="internal-windows-clean"><h3>Internal Windows Clean</h3><ul><li>Wipe down of glass surface and cobweb removal around accessible areas.</li></ul></div><div data-modal-content="carpet-steam-clean"><h3>Carpet Steam Clean</h3><ul><li>Professional steam clean of carpet and other items where applicable.</li></ul></div><div data-modal-content="additional-balcony-clean"><h3>Additional Balcony Clean</h3><ul><li>Dusting, sweeping and mopping of accessible surfaces for an additional balcony.</li></ul></div><div data-modal-content="fridge-clean"><h3>Fridge Clean</h3><ul><li>Wipe down of accessible surfaces.</li></ul></div><div data-modal-content="wall-wash-clean"><h3>Wall Wash Clean</h3><ul><li>Wipe down and dusting of walls.</li></ul></div><div data-modal-content="carpet-steam-clean"><h3>Carpet Steam Clean</h3><ul><li>Professional steam clean of carpet and other items where applicable.</li></ul></div><div data-modal-content="garage-clean"><h3>Garage Clean</h3><ul><li>Wipe down, dust and sweeping of all accessible areas.</li></ul></div></div><div class="cf-booking__nav cf-booking__nav--right cf-active" data-step="1"><div class="cf-booking__nav-button cf-next cf-btn" data-step="1" data-step-target="2">Next</div></div></div><div class="cf-booking__time-step cf-booking__step-item checkout-time-selector" data-step="2"><div class="cf-booking__title checkout-mt-0"> Time and Date</div><div class="cf-booking__time-date"><div class="cf-booking__time-date-input"><div class="cf-booking__date"><div class="cf-booking__date-icon"> <img src="https://whizz.com.au/base-custo